import React, { Component } from 'react';
import { Palette } from 'react-palette';

class TheColor extends Component {
    render() {
        return (
            <div>
                <Palette src={"https://s3.amazonaws.com/ebaumsworld.prod/uploads1562181057433-gamerpride.jpg"} colorCount={2}>
                    {({ data, loading, error }) => (
                        <div style={{ color: data[0], backgroundColor: data[1] }}>
                            Text with the predominant color
                        </div>
                    )}
                </Palette>
            </div>
        )

    }
}


export default TheColor;
